import '../Styles/Home.css'
import LocationCard from '../Components/LocationCard'

function Home() {
  const [locations, setLocations] = useState([]);
  console.log(locations);
  useEffect(() => {
    fetch("/locations.json")
      .then((response) => {
        response.json();
      })

      .then((data) => {
        setLocations(data);
      });
  }, []);

  return (
    <></>
   
  );
}

export default Home;
